  false,\n\t\"url\": null,\n\t\"notes\": \"Pursuant to New York Cityu2019s Housing
  Maintenance Code, the Department of Housing rnPreservation and Development (HPD)
  collects information on multiple dwellings in New York rnCity, and other buildings
  that fall under its jurisdiction. HPDu2019s Buildings Open Data covers all rnbuildings
  which meet any of the following criteria: rn rna. HPD has required the owner to
  register the building under the Housing Maintenance rnCode (HMC) rnb. HPD has initiated
  a litigation action under the HMC rnc. HPD has received a complaint for the building
  rnd. HPD has initiated a work order for the purposes of emergency repair, demolition,
  or rnthe Alternative Enforcement Program (AEP) for the building rne. HPD has added
  the property to the AEP programrnrnBuildings are identified by a BuildingID.\",\n\t\"owner_org\":
